    <td colspan="6" align="center" bgcolor="#efefef" width="140"><b><font COLOR="#000000">注意事項</font></b></td>
    <td bgcolor="#FFFFFF" width="572"><FONT SIZE="-1">●生地の特性上、やや匂いが強く感じられるものもございます。<br>
    数日のご使用や陰干しなどで気になる匂いはほとんど感じられなくなります。<br>
    ●製品によっては、生地の特性上、縮む場合がございますので洗濯時はご注意下さいませ。<br>
    ●生地によっては摩擦（特に湿った状態）や、汗や雨などで濡れたときは他の衣類や下着に移染する場合がございます。<br>
    また淡色物に色移りする場合がございますので、お洗濯後はすみやかに（脱水、乾燥等）するようにお願いいたします。<br>
    ●商品写真はできる限り実物の色に近づけるよう加工しておりますが、お客様が使用するパソコンのモニター設定や部屋の照明により多少、色の変化が感じられる場合がございます。<br>
    ●機械による生産の為、生地の継ぎ目の若干のズレやほつれなど、形やサイズに多少の誤差が生じる場合がございます。<br>
    また、混紡繊維によって生地の織りに他繊維が混紡している場合もございますが品質上の問題はございません。<br>
    ●商品の特性上、生地の取り位置によりどうしても絵柄の出方・ニュアンスなど多少の個体差が生じ、
<br>
    画像と表情が異なることがございます。また柄が縫い合わせ部分で必ずしも合っていないことがございます。<br>
    ●サイズ詳細等の測り方はスタッフ間で統一、徹底はしておりますが、<br>
    実寸は商品によって若干の誤差(3cm～5cm )がある場合がございますので、予めご了承ください。<br>
    サイズについて詳しくは<a href="http://item.rakuten.co.jp/sunflower8/c/0000000176/" target="_blank"><FONT COLOR="#cc0000" SIZE="-1">コチラ</FONT></a> !<br>
    ●同じ商品でも“生産時期”や“カラー“により形やサイズに多少の“誤差“が生じる場合もございます。<br>
    詳しくは商品画像や実寸サイズにてご確認くださいませ。<br>
    ●プリント生地の商品については、生地の裁断・縫製方法により写真と同様の柄が出ない場合がございます。<br>
    ●実際の色に近づけるため、タグのカラー名称と異なる場合がございます。<br>
    ●商品の性質上、次の商品は返品交換をお断りしております。<br>
    （※一部レギンス・スパッツ・水着）<br>
